/*Table structure for table `t_user_point` */

DROP TABLE IF EXISTS `t_user_point`;

CREATE TABLE `t_user_point` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `parkName` varchar(50) DEFAULT NULL COMMENT '园区名',
  `buildName` varchar(50) DEFAULT NULL COMMENT '楼栋名',
  `floorName` varchar(50) DEFAULT NULL COMMENT '楼层名',
  `lon` double(10,6) DEFAULT NULL COMMENT '经纬',
  `lat` double(10,6) DEFAULT NULL COMMENT '纬度',
  `iconUrl` varchar(50) DEFAULT NULL COMMENT 'url',
  `lable` varchar(50) DEFAULT NULL COMMENT '标签',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=269 DEFAULT CHARSET=utf8;

